import "./productList.css";
import Product from "../product/Product";
import { products } from "../../data";

const ProductList = () => {
  return (
    <div className="pl">
      <div className="pl-texts">
        <h1 className="pl-title">Подивіться на нашу чудову політехніку</h1>
        <p className="pl-desc">
          Націона́льний університе́т «Льві́вська політе́хніка» — найстаріший
          технічний заклад вищої освіти України та Східної Європи, заснований у
          1816 році як Реальна школа з дозволу австрійського імператора Франца
          І.
        </p>
      </div>
      <div className="pl-list">
        <Product img={"../../img/screenshot.png"} link={"https://lpnu.ua/"} />
      </div>
    </div>
  );
};

export default ProductList;
